import {BrowserRouter} from 'react-router-dom';

import './App.css';

import Main from './Components/Main/Main.js';

class App  extends Component {
  render() {

    return (
      <BrowserRouter>
        <div>
          <Main></Main>
        </div>
      </BrowserRouter>

    )
  }
}

 export default App;
